import React from 'react';
import '../App.css';
import PropTypes from 'prop-types';

class MovieList extends React.Component {
  render() {
    const { title, subtitle, storyline, rating, imagePath } = this.props.movies;
    return (
      <h2>{ title }</h2>
    );
  }
}

export default MovieList;
